        "title": "Girl Scouts Brownies Custom Troop T-Shirt Iron-On Transfer Design, Custom Troop Number and Child&#39;s Name or Troop City, You Print",
        "description": "THIS IS FOR A CUSTOM DIGITAL FILE ONLY!  \nT-SHIRT AND IRON-ON TRANSFER PAPER SOLD SEPERATELY, NOT INCLUDED!  \n\nWatermarks will not be shown on final files.\n\nMake your own Girl Scout Brownie Troop T-shirts for your child or the whole troop. Purchase this digital file and print as many as you would like OF THE SAME DESIGN on Iron-On Transfer Paper (found at any office supply or craft store). \n\n\nCheck out Matching Coordinates for this item.\nhttps://www.etsy.com/shop/suzyqdigitaldesigns/search?search_query=troop\n\n**********************************************************************\nWOULD YOU LIKE A GIRL SCOUT OR \nDAISIES TSHIRT TRANSFER INSTEAD? \n********************************************************************** \nSEE OUR LISTING FOR THE SAME TRANSFER IN GIRL SCOUT OR DAISY COLORS....\n\nDAISIES\nhttps://www.etsy.com/listing/197475489/a-daisy-girl-scouts-custom-troop-t-shirt?ref=listing-0\n\nGIRL SCOUTS\nEmail me for a sample of our girl scout layout (it is similar with green colors and the trefoil in place of the elf.  \n\n*******************************\nFOR 2+ TRANSFERS\n*******************************\nFor MORE THAN ONE transfer with separate names, please use the drop down menu to select the number you need ($5 first shirt and $2 each additional) and provide the names in the &quot;message to seller&quot; box at checkout or email me at suzyq10445 [!at] gmail.com. \n\n**BUY MORE, SAVE MORE**\n\nIF YOU ORDER A TOTAL OF 11+ SHIRT DESIGNS, THE COST OF EACH ADDITIONAL SHIRT DESIGN IS ONLY $1.\n\nIf you need more than 20, just send me a note and I&#39;ll send you a private listing.\n\n\n*********************************\nIMAGE SIZE\n*********************************\nSelect your image width from the drop-down menu. The length will be approximately 2&quot; shorter than the width. \n\nI RECOMMEND PRINTING A SAMPLE ON REGULAR PAPER BEFORE PRINTING ON TRANSFER PAPER & LAYING IT ON YOUR SHIRT TO DOUBLE-CHECK THE SIZE. \n\n\n**********************************\nWHAT YOU WILL GET\n**********************************\n- One (1) PDF file of the image on a white background\n- One (1) PDF file of the mirror image on a white background\n\n***PLEASE NOTE*** MOST PRINTING LOCATIONS WILL NOT PRINT ON TRANSFER PAPER SO IF YOU DON&#39;T WANT TO PRINT AT HOME, CALL THEM TO CONFIRM BEFORE PURCHASE. \n\n\n****************************************\nHOW TO ORDER A DIGITAL FILE\n****************************************\nSTEP 1 Select your choice of city or name, the number of designs (each with separate name) and pick your size in the drop down menu. Add the item to your cart and check out\n\nSTEP 2 Enter the details of your order in the &quot;message to seller&quot; box at checkout. \nProvide the following:\n\n-- Troop number\n-- City name or Child&#39;s Name(s)\n-- Other special requests\n\nSTEP 3 You will receive an email or convo from me with an estimated time needed to provide you with your first proof. Please allow up to 24 hours. Your proof will be sent to the email address on file. \n\nSTEP 4 Purchase iron-on transfer paper from any office supply store (ie. Staples, Office Depot, etc.) or craft store (ie. Michaels, Hobby Lobby, etc.) or online. The best quality paper is available online at amazon.com and it is called JetPro Softstretch (for light shirts) or JetPro Softstretch (for dark shirts)\n\nSTEP 5 Purchase a white or light colored cotton t-shirt, found at most craft stores (or department stores). Dark colored shirts can be used but you have to purchase the transfer paper specially made for dark shirts but PLEASE NOTE: TRANSFER PAPER FOR DARK SHIRTS WILL IRON A WHITE LAYER ON THE SHIRT IN ANY UNTRIMMED AREAS. \n\nJust ask me about a design for dark shirts that has a border around the image making it easier to trim. I can send a sample.\n\nSTEP 6 Follow the instructions closely for your brand of iron-on transfer paper. Most papers for light shirts will require you to use the mirror image. \n\n———————————————————————————————————————————\nIMPORTANT INFORMATION\n———————————————————————————————————————————\nAdobe Reader is needed to open all SuzyQ Digital Designs. You can download adobe reader for free at http://get.adobe.com/reader.\n\nPLEASE NOTE: This file is for personal use only. You may not forward, share, sell or distribute the file. It is for non-commercial use only.\n\nNote that the images, characters and trademarks used in the invitations and party decor items are not licensed products and are not being sold. SuzyQ Digital Designs does not claim any ownership over the characters and trademarks used in our customized designs, they solely belong to their respective copyright owner. Your purchase is for our labor, time, and creative used to make your custom party.\n\n\nThank you for choosing SuzyQ Digital Designs!",
