        "title": "BG Originals the Bay dress and top pdf pattern",
        "description": "When the days get longer and the sun gets warmer - we all know that the sweet joys of summertime are right around the corner. Make sure your little one is ready with her own version of the Bay by brownie-goose. With the options of a flutter sleeve or not, this sweet sundress screams classic design. But then you see the back, and that sweet, swooping wrap-back almost takes your breath away. Oh my stars - that back. Gets me every time. The Bay combines timeless designs with classic lines and is perfect for days spent in the sun followed by nights of chasing fireflies.\r\n\r\nThis pattern comes with instructions for a dress, top or drop-waist dress and includes a tutorial on a curved AND straight back skirt piece. \r\n\r\nThis e-pattern includes step-by-step instructions with lots of pictures to guide you through the construction of the dress/tunic with a glossary of terms in the back. \r\n\r\nSizes - 18 mo, 2, 3, 4, 5, 6, 7, 8, 10 and 12.\r\n\r\nFor information on materials needed and a sizing chart for this pattern, please visit this link (http://browniegoose.blogspot.com/search/label/size%20chart%20list) and click the appropriate pattern.\r\n\r\nThis listing is for the pdf pattern, NOT the actual dress/top.\r\n\r\nThis pdf is now available in instant download, yippee! No time to waste before you begin! You will receive an email to the address that Etsy has on file within 5 minutes of purchase with a link and instructions to download your pattern. If you do not receive an email - please let me know at browniegoose@hotmail.com. Remember - this will come to the email that Etsy has on file for you! You can also log in to your Etsy account and go under “purchases” to  see files that are ready for download. Instant gratification at its best! :)\r\n\r\nThe Bay dress & top is a BG Original and the pattern and all images are the property of brownie-goose and are copyrighted. This pattern may not be used without my permission.You may not resell this pattern itself, but PLEASE sell the items you create from it! Design away my dearys. :)\r\n\r\nThanks & happy sewing from Amy at BG.",
