            "title": "The Wild World: A world of vintage finds! ",
            "announcement": "Welcome! We carry an eclectic array of vintage items from kitchenware to home decor. Check out our sections for Revere Ware, Pyrex, Corning, Bake ware, Mugs, Decor, and more! We also carry linens, clothing, accessories, and jewelry from time to time. New items added weekly!",
            "currency_code": "USD",
            "is_vacation": false,
            "vacation_message": null,
            "sale_message": "THANK YOU so much for shopping with us. If you have any questions or concerns, please feel free to contact the shop and we will get back to you as soon as possible. \r\n\r\n\r\nINTERNATIONAL BUYERS:\r\nPlease note that there may be a tax or tariff on your purchase. The percentage depends on your countries customs and tax rates, so please check with them beforehand if you are unsure of what they might charge you. It is the responsibility of the buyer to pay their individual countries import taxes.",
            "digital_sale_message": null,
            "last_updated_tsz": 1431307034,
            "listing_active_count": 379,
            "login_name": "Imaginarily",
            "accepts_custom_requests": false,
            "policy_welcome": "Unique items are what make a home or any space special. We strive to bring you original, and unique art and vintage items to add a little flair to any room. ",
            "policy_payment": "We accept Direct Checkout and PayPal ",
            "policy_shipping": "-Items ship 1-5 days after purchase. \r\n\r\n-We can combine shipping on multiple items, and we refund extra shipping charges over $2 (in the case that shipping is lower than estimated).\r\n\r\n-A tracking number is included so you will know where your package is while it ships to you (excluding some countries were tracking may not be available). \r\n\r\nSHIPPING DISCOUNTS:\r\nThere may be discounts on shipping based on where you live. The shop is in California and shipping is calculated to New York. We refund shipping costs over a couple dollars. We can also re-calculate shipping beforehand if you send your zip code before purchase. \r\n\r\n______________________\r\n-INTERNATIONAL-\r\n______________________\r\n\r\nOVERSEAS SHIPPING: \r\nWe can ship to certain countries, but we will have to recalculate shipping based on your location. Just tell us which country you live in and we can calculate shipping and give you a quote. We cannot ship to certain countries due to limits, laws, or difficulty with delivery and mail systems in these countries. \r\n\r\nTARIFFS and TAXES:\r\nWe are not responsible for any tariffs or taxes on the package when it arrives in your country. We have no way of knowing, calculating, or assessing these possible taxes, and they are legally the buyer&#39;s responsibility. \r\n\r\nFREIGHT FORWARDING COMPANIES:\r\nWe have become aware that some customers live in other countries and use a freight company to ship overseas. If you are using a company to ship overseas, we are not liable for breakage, loss, or insurance to that country. We only insure the item to its U.S. destination provided in the receipt. Once it has arrived, we are not responsible for insurance claims, damage or loss incurred. \r\n\r\n",
            "policy_refunds": "DAMAGE and INSURANCE CLAIM:\r\n- We try to pack things very well with bubble wrap. In the case items are damaged in shipping, please contact the shop within 7 days of your item&#39;s arrival. If something arrives broken, there is no need to ship it back. Keep the wrapping, box, and item, and take a photo of it and send the photos to us as proof of damage. We need the photo as proof of damage for insurance claims at the Post Office. \r\n\r\n-Buyer must sign an affidavit for any insurance claims, before any money can be refunded. Policies will also vary based on payment method (uPic insurance or USPS). \r\n\r\nRETURNS (not damaged):\r\n-We accept returns and have a 7-day return policy. Please contact a shop within 7 days of your shipment arrival if you wish to make a return. The item has to be returned to the shop before we will give a refund, and must arrive in the same condition it left the shop. The buyer is responsible for the cost of return shipping. We will then refund the cost of the item (minus shipping costs)\r\n\r\nWRONG ADDRESS:\r\n-Be sure to double check your address. We cannot offer refunds if the address given to us is wrong or inaccurate.\r\n\r\n\r\n",
            "policy_additional": "ABOUT VINTAGE\r\nWe try to describe items as they are. Items are vintage and have been used, so they will probably show some signs of use. We try to list any issues, chips, cracks, crazing, or condition issues. Please be aware that all items are used (except for those still in the box) and are at least 20 years old.\r\n\r\nSMOKE/PET FREE HOME\r\nAll items currently come from a smoke and pet free home. However, we don&#39;t know what kind of home they came from before they were &quot;rescued&quot;. Please be aware there is a possibility an item might have some sort of mild scent. \r\n\r\nUSER WEAR/TEAR\r\nWhen using vintage kitchenware, be aware that some items were not meant to be used in the microwave or dishwasher. We cannot give any refunds for items that broke due to heat changes or other situations during use. We cannot give refunds for tableclothes or clothes which have been washed and shrunk in the dryer after arrival, for example. ",
