        "title": "12 Dark Chocolate Cocoa Doughnuts with Dark Chocolate Peanut (or Almond) Butter Icing ( Low Carb, Sugar Free, Gluten Free, Grain Free)",
        "description": "This is the dark chocolate cocoa doughnuts with dark chocolate and peanut butter icing. You get 12 regular size doughnuts. These are the regular size cake doughnuts.  I eat one of these for breakfast and the protein and good fats make them very filling.  These are big, nice doughnuts.  They have about 5 net carbs each including the icing.\n \nThese are made with almond flour, coconut flour, dark chocolate cocoa powder, organic extra virgin coconut oil, free range organic eggs, cinnamon, nutmeg, vanilla, erythritol, stevia, and aluminum free baking powder.  The icing has Lindt 85% dark chocolate, natural chunky peanut butter, stevia, erythritol, real butter, and organic extra virgin coconut oil.\n\nThese are low carb, gluten free, grain free, sugar free, and made with natural sweeteners. The coconut oil also gives you a metabolic boost. These are high in protein and good fats and will keep you full for a long time. They are also very diabetic friendly. These taste so good you will never realize you are eating so healthy!\n\nHere is the nutritional info that I have come up for these. They are made by hand instead of a machine so this is not an exact measure, but is based on dividing my recipe by 12:\n\ndougnuts without icing:\n330 calories each\n30 grams of fat - 270 calories from fat\n7 carbs - 28 calories from carbs\n4 grams fiber = 3 net carbs per doughnut\n8 grams protein - 32 calories from protein\n\nicing for each doughnut:  (12 servings)\n\n103.5 calories per serving\n9.5 grams of fat -  85.5 calories from fat\n2.5 carbs - 10 calories from carbs\n1 gram fiber = 1.5 net carb per serving\n2 grams protein - 8 calories from protein\n\n\n\nI will pack the icing separately and you can just melt the icing a bit, spoon the icing over them, refrigerate. and eat.  I will put the directions in the box with them, but it is very simple.  I will pack them iced if you request, but there may be some melting that occurs if I do that.  \n\nThese are made to order and I can substitute items as needed.  If you are allergic to peanuts or do not eat peanuts, I can substitute almond butter or sunflower seed butter for the peanut butter.  All orders are shipped USPS priority.  I highly prefer to ship Monday thru Wednesday so your order does not sit at the post office over the weekend.\n\n\nAllergen Information: Items contain EGGS and NUTS.\n\nBeautiful photography provided by Kaysi Jacks Photography. \nFor information please visit her Facebook page: \nhttp://www.facebook.com/#!/pages/Kaysi-Jacks-Photography/119907081430729",
