            "title": "Pies, Cookies, Cake Pops, Cake Bites, Brownies and More",
            "announcement": "Mothers day is coming up soon. Why not send her some sweets? Use coupon code Mama2015 for 10% off. \r\n\r\nCrumbtastic is a state inspected bakery full of yummy baked goodness. \r\nWelcome to the cutest and most delicious little corner on Etsy!\r\nWe love to make delectable bites for you your parties, or just because. Take a look around and see if anything strikes your fancy! Remember drooling is completely acceptable! \r\n\r\nCheck out our Facebook at www.facebook.com/crumbtastic. \r\n\r\nAll goodies are made from scratch just for you! We would love to be a part of your event or special day just let us know! Know someone who loves sweets let us know and we can ship your gift straight to them. We can even include a special message!",
            "currency_code": "USD",
            "is_vacation": false,
            "vacation_message": null,
            "sale_message": "Thanks so much for ordering from us we appreciate your business. \r\nSoon you will be receiving a message that includes your tracking info and expected delivery date. All of our orders have a 3-5 business day processing time unless it is a custom listing with a specified delivery date. \r\n\r\nIf this order is between the months of May-Sep and covered in chocolate or candy melt someone will need to be home at time of delivery. During the summer months these products are susceptible to melting if left on a porch or in a mailbox. \r\n\r\nDon&#39;t forget to check out our store page for coupon codes or specials! \r\n\r\nWe hope to see you again and  have a great day!",
            "digital_sale_message": null,
            "last_updated_tsz": 1432148833,
            "listing_active_count": 113,
            "login_name": "Cupsweet",
            "accepts_custom_requests": true,
            "policy_welcome": "Welcome to Crumbtastic the most delish corner on Etsy. If you&#39;re looking for yummy treats to tantalize your taste buds then you&#39;ve come to the right place. Have a seat, take look around, and feel free to drool. We make brownies, cookies, cakes, bite size treats and more.\r\n\r\nWe are inspected by the state of North Carolina and follow all state regulations when preparing our goodies. We make everything we sell from scratch with all natural ingredients. \r\n\r\nWe love to make goodies and want to be a part of your events or special day. Know someone who loves sweets let us send them some for you! ",
            "policy_payment": "♥ Payment Policies ♥ \r\n\r\n• We accept payment through direct checkout and Paypal. \r\n• We now except Etsy gift cards!\r\n• Orders will be set to be made once payment is received and processed.\r\n• Large custom orders for events must be paid in full before it is put on our books.\r\n• We cannot accept checks at this time sorry for any inconvenience this may cause",
            "policy_shipping": "•Most of our items are delicate in nature and will not hold up to well in the heat and or melt. During the months of May-Oct ice packs and insulated packaging is added to our shipping prices. \r\n\r\n• If you would like your item to arrive around a special time or event let us know so we can have your items to you on time. Please allow 3-5 business days from the time you order until an item is made and shipped. If you need an order express shipped let us know and we can set that up for you for an extra charge. If you are ordering late for an event let us know we can see what we can do in getting your order made and out to you quicker no guarantees can be made.\r\n\r\n•  All orders are shipped with priority shipping (2-3 day mail) which includes tracking and delivery confirmation. We will send a note letting you know when your order has shipped complete with a tracking number. Express shipping offers guaranteed date and delivery. You can get express shipping for an extra charge. \r\n\r\n• During the months of May-Oct someone must be available to receive your items in the mail. Please let your recipient know that they have a package coming. I know you would like to have it a complete surprise but with the heat the way it is during the warmer months it&#39;s not advisable. Let the yums inside be the surprise. If they are left outside or in the mailbox they will surely melt even with the cold packs that are provided during warm months. \r\n\r\n• All our orders are packed with extra special care to avoid damage during shipping. However, once it leaves us it&#39;s in the hands of the Post Office. We cannot control any damage that may occur during shipping from postage handlers or transit. We strongly recommend insurance be added to orders totaling 50$ or more. ",
            "policy_refunds": " If you&#39;re unhappy with your order please let us know and we will do our best to make things right. We want you to enjoy your goodies and experience with us.  ",
            "policy_additional": "We do custom orders and would love to be a part of your event, party or gift giving. Talk to us let us know what you have in mind and we&#39;ll see what we can do.",
            "policy_seller_info": null,
