        "title": "Old-fashioned Whimsical Nightlight - Kodak Brownie Bullet or Holiday Camera",
        "description": "Original Vintage Kodak Brownie Bullet Camera – modified into a working premium nightlight.\nRemarkable camera with some signs of years of service.\n\nThis camera nightlight is a great present for the collector of vintage memorabilia and retro artifacts, giving them a chance to display a real vintage camera. \nThe replaceable light bulb at the center is a play on the bright flash that once came out of this camera while it was in its prime.\n\nUse standard incandescent nightlight bulbs (7w or 4w) with a light sensor (will only light up during the night).\nFit in most standard U.S. 120V receptacle.\nCamera is 4&quot; x 3&quot; x 3&quot;\n\nHistory:\n\nType: Solid body eyelevel rollfilm\nIntroduced: Sept 1957\nDiscontinued: 1964\nFilm size: 127\nPicture size: 1 5/8 X 2 1/2&quot;\nManufactured: US, Brazil\nLens: Dakon\nShutter: Rotary\nNumbers made: ?\nOriginal price: promotional\n\nThe Brownie Bullet is a promotional, or &quot;premium&quot;, exact copy of the Brownie Holiday camera. It has a moulded black plastic body with white, cream, or grayish controls. \n\nFun Facts:\nSome Kodak cameras, like the Brownie Bullet, were described as &quot;premium&quot;. These are cameras that were not normal retail items, but used for promotional purposes often by third-party companies to encourage customers to take advantage of their goods or services. This illastrates marketing genius on Kodak&#39;s part. A third-party company benefits by selling their own product, the customer gets a free camera, and Kodak gains a new customer that will buy their film and process it!\n\nCAUTION:\nRisk of Electric Shock and Fire Hazard.\nThis is not a toy and is not intended for use by children. For adult use only.\nFor safe use, plug only into exposed wall outlets where a device is ventilated and cannot contact bed coverings or other material.\nDo not use with extension cords.\n\nAre you looking for one with more &quot;features&quot;?\nCheck out my USB Charger Nightlight\nhttps://www.etsy.com/listing/127754660/usb-charger-nightlight-upcycled-vintage\nor one with a color changing LED\nhttps://www.etsy.com/listing/124491857/vintage-camera-led-night-light-kodak",
