        "title": "Vintage Camera Nightlight - White Kodak Brownie Starflash",
        "description": "Original White Kodak Brownie Starflash Camera – modified into a working 120V nightlight.\r\nThis is a very distinctive camera with some signs of years of service.\r\n\r\nThis camera night light is a great present for the collector of antique memorabilia and retro artifacts, giving them a chance to display a real antique camera. \r\n\r\nThe incandescent light bulb at the flash center is a play on the bright flash that once came out of this vintage camera while it was in its prime.\r\n\r\nIt uses normal night light bulbs (7w or 4 w incandescent) and has a light sensor (will only light up during the night).\r\nIt fits in most standard U.S. 120V receptacle.\r\nCamera size is 2.75&quot; x 3.5&quot; x 5.5&quot;\r\n\r\nCAUTION:\r\nRisk of Electric Shock and Fire Hazard.\r\nThis is not a toy and is not intended for use by children. For adult use only.\r\nFor safe use, plug only into exposed wall outlets where a device is ventilated and cannot contact bed coverings or other material.\r\nDo not use with extension cords.\r\n\r\nHistory:\r\nType: Solid body eyelevel rollfilm\r\n Introduced: March 1957\r\n Discontinued: June 1965\r\n Film size: 127\r\n Picture size: 1 5/8 X 1 5/8&quot;\r\n Manufactured: US, France\r\n Lens: Dakon\r\n Shutter: Rotary\r\n Numbers made: ?\r\n Original price: $8.50 all models Coca-Cola was promotional\r\n\r\nDescription:\r\nThe popular Brownie Starflash has a moulded plastic body, optical direct vision finder, and handy built-in flash gun for capless bulbs. \r\n\r\n Variations:\r\n March 1957-June 1965: Black Model\r\n March 1958-Oct 1960: Red Model\r\n March 1958-Aug 1962: White Model\r\n March 1958-Feb 1962: Blue Model\r\n Oct 1959-Dec 1961: Coca-Cola Motif For Promotional Use\r\n\r\nThis camera was also supplied in an outfit for close-up photography as the Kodak Startech Camera. \r\n\r\nFun Facts:\r\nThe Brownie Starflash Camera was a truly all-in-one imaging device in it&#39;s day. The built-in flashgun and small size made this camera extremely portable and easy-to-use.\r\nThis beautiful camera was designed by Arthur H. Crapsey, the designer of many popular Kodak cameras.",
