            "policy_refunds": "Refunds/Exchanges\r\n\r\nMy error - if I make a mistake, I will send you a replacement / exchange asap. Please email me.\r\n\r\nCustomer error - I cannot accept returns on, personalized, or special-order items, or on items damaged through normal wear and tear. Many of my products are made using vintage items that show their age – this is part of the product.\r\n\r\nI stand behind the products I make and sell and your satisfaction with your purchase is extremely important to me. If you are dissatisfied with the quality of your purchase, please contact me via Etsy.\r\n\r\nI will only refund money - minus my shipping costs - if we can not come to an agreement regarding any problem you may have. If there is ANY problem with your order, please contact me through the Conversation system so I may address your problem. I will do my very best to make sure you are satisfied with your order. Please, DO NOT leave me feedback if there is a problem and you have not contacted me first. \r\n\r\nDo not open a non-delivery case against me if the package is being tracked and is clearly sitting at a postal facility. Contact me first, please, and I will resend your package to you.\r\n\r\nIf a package is well and truly lost, I will do my best to replace it for you. ",
            "policy_additional": "I take custom orders. Please contact me if you have any questions.\r\nIf you can&#39;t find what you are looking for - take a look at my sold items and contact me for a special order:\r\nhttps://www.etsy.com/shop/LightAndTimeArt/sold",
