        "description": "This order is for 12 absolutely adorable cupcake or cookie toppers. They measure approximately 2 1/2- 3 inches and can be color customized. Just add a message in the notes to seller section during purchase. They are completely edible and taste wonderful. I make my own fondant so it tastes much better than store bought. \r\n\r\nJust slap these suckers on a cupcake or sugar cookie and you will be the hit of your next shindig!! \r\n\r\nThese fondant toppers are made to order after payment is received. I prefer to ship items closer to your event date in order to maintain freshness. Please provide the date of your event along with your purchase in the notes to seller section. If you need something rushed, please convo me and I will see what I can do!\r\n\r\nEach item is individually wrapped and packaged to allow for stress-free shipping. \r\n\r\nFondant toppers are edible for up to one year from date received.\r\n\r\nToppers should never be refrigerated or frozen. They store well in a plastic container (tupperware). Just move them to a cool dry area away from heat and light.\r\n\r\nI LOVE custom orders and would enjoy working with you to create the perfect little addition to you next party. \r\n\r\n\r\nIf you are in the Utah County area, I would love to bake up some delicious cupcakes or cookies for you next party. Convo me for details.\r\n\r\nThanks for checking me out",
