            "policy_shipping": "Shipping Policy\r\nAll orders are shipped from Orlando, FL.  Orders usually leave within 1-3 business days, and shipments usually arrive within 4-7 days via USPS Standard or Priority Mail.  If you need your order sooner, please contact us, and we will discuss your expedited shipping options.  Larger orders may qualify for free shipping.  Please feel free to inquire.",
            "policy_refunds": "Replacement Policy\r\nWe want you to be happy with your purchase.  If an item arrives damaged, we will replace the item at no additional cost to you.  Please notify us within seven days of receipt, and we will promptly send you a replacement.\r\n\r\nReturn Policy\r\nWe want you to be happy with your purchase.  If for any reason a product does not meet your needs or expectations, we will gladly accept a return.  Items may be returned to us for any reason, as long as they are unused, undamaged, and complete.  \r\n\r\nTo return an item, simply following these steps:\r\n1) Notify us within seven days of receipt that you wish to make a return.\r\n2) Pack the item for safe return, and include the original invoice.\r\n3) Mail the item back to us via any insured mail service. (Return shipping and insurance costs are a customer responsibility.)\r\n4) Expect a prompt refund as soon as we receive your return.",
            "policy_additional": "FAQ\r\n\r\nCan you handle custom requests?\r\nAbsolutely!  We love taking your theme and bringing it to life!  Just use the &quot;Request a Custom Order&quot; button on the shop homepage to let us know what you have in mind.  You can also contact us directly.\r\n\r\nAre all your products home-made?\r\nWe use a combination of home-made pieces and specially selected products to make our party favors, gifts, and craft kits one-of-a-kind.\r\n\r\nWhere do you get all your ideas?\r\nYears of teaching, scouting, and parenting!\r\n\r\nI like a product, but I would like to make some changes?  Is that possible?\r\nYes! Just use the &quot;Request a Custom Order&quot; button on the shop homepage to let us know what you have in mind.  You can also contact us directly.\r\n\r\nWhat is the recommended age range for your craft kits?\r\nMost of our kits are suitable for kids age 5 to 105.  However, it is best to base your ordering on the skill and maturity level of your child or group of children.  Some projects may be frustrating for little hands, and some may require additional adult helpers.  Always keep small pieces away from children under 5 years of age to prevent accidental choking.\r\n\r\nWhat is the recommended age range for your party favors?\r\nOur party favors are suitable for kids age 5 to 105.  As much as possible, we try to include products with lasting appeal for all members of a group or family.\r\n\r\nDo you sell additional supplies that are needed to complete your craft kits?\r\nWe don&#39;t include some supplies (like scissors and glue) with our craft kit orders because many people already have these supplies on hand.  We don&#39;t want our customers to be forced to purchase supplies they already have.  If there is something you need, please contact us. We&#39;ll see what we can do!\r\n\r\nWhat are SWAPs?\r\nSWAPs are crafts, usually handmade, that are swapped between Girl Scouts.  The acronym, SWAPs, stands for “Something With A Pin” or “Special Whatchamacallits Affectionately Pinned Somewhere.”  The best SWAPs are girl-made and come with a message tag that identifies the Scouting event, troop, girl, or purpose of the SWAP.  SWAPs should also include a safety pin or pin-back.  Girl Scouts pin SWAPs on hats or hand-crafted SWAP holders.\r\n\r\nAre SWAPs just for Girl Scouts?\r\nNo way!  SWAPs are just crafts with a pin. Anyone can SWAP!\r\n",
            "policy_seller_info": "Mini Me Crafts, LLC\r\n3208 East Colonial Drive, #223\r\nOrlando, FL 32803\r\n407-765-7886 (phone)\r\n407-898-8209 (fax)\r\nminimecrafts@outlook.com (e-mail)\r\nminimecrafts.com (website)\r\npinterest.com/minimecrafts (pinterest)\r\nyoutube.com/minimecrafts (video tutorials)",
