            "policy_welcome": "Two years ago I lost my Grandmother and inherited everything my family has ever owned and forgotten about, as well as a two family home that sits on .111 acres in Upstate NY.\r\nThe Mercer Street Project is an exploration in self-archiving in which I will chronicle, cleanout, and curate the ghosts and memories that have been packed away for years in my childhood home. Through this project I hope to answer and explore questions of family displacement, identity and disappointment. I plan to center the project around the sharp juxtaposition between who our families set us up to be and who we&#39;ve chosen to be.\r\nAt the end of this project I hope to close the Upstate NY chapter of my life. I feel it is only with a clear picture of our version of our past that we are able to move forward. As I try to rid myself of this history and things, I hope others can re-appropriate items, themes or images in a way that can give these things a new purpose and change the trajectory of our past&#39;s influence over who we are. ",
